        "# Membagi data menjadi training dan test set\n",
        "def split_data(X, y, test_size=0.2, stratify=True):\n",
        "    \"\"\"\n",
        "    Membagi data menjadi training set dan test set\n",
        "    \"\"\"\n",
        "    if stratify:\n",
        "        X_train, X_test, y_train, y_test = train_test_split(\n",
        "            X, y, test_size=test_size, random_state=RANDOM_STATE,\n",
        "            stratify=y\n",
        "        )\n",
        "    else:\n",
        "        X_train, X_test, y_train, y_test = train_test_split(\n",
        "            X, y, test_size=test_size, random_state=RANDOM_STATE\n",
        "        )\n",
        "\n",
        "    print(f\"Training set: {X_train.shape[0]} samples\")\n",
        "    print(f\"Test set: {X_test.shape[0]} samples\")\n",
        "\n",
        "    return X_train, X_test, y_train, y_test\n",
        "\n",
        "# Vectorization teks\n",
        "def vectorize_text(X_train, X_test, vectorizer_type='tfidf', max_features=5000, ngram_range=(1, 2)):\n",
        "    \"\"\"\n",
        "    Mengubah teks menjadi vektor fitur\n",
        "    \"\"\"\n",
        "    if vectorizer_type == 'tfidf':\n",
        "        vectorizer = TfidfVectorizer(\n",
        "            max_features=max_features,\n",
        "            ngram_range=ngram_range,\n",
        "            min_df=2,\n",
        "            max_df=0.95\n",
        "        )\n",
        "    else:\n",
        "        vectorizer = CountVectorizer(\n",
        "            max_features=max_features,\n",
        "            ngram_range=ngram_range,\n",
        "            min_df=2,\n",
        "            max_df=0.95\n",
        "        )\n",
        "\n",
        "    X_train_vectorized = vectorizer.fit_transform(X_train)\n",
        "    X_test_vectorized = vectorizer.transform(X_test)\n",
        "\n",
        "    return X_train_vectorized, X_test_vectorized, vectorizer\n",
        "\n",
        "# Split data\n",
        "X_train, X_test, y_train, y_test = split_data(X, y, test_size=0.2, stratify=True)\n",
        "\n",
        "# Vectorization\n",
        "X_train_vec, X_test_vec, vectorizer = vectorize_text(\n",
        "    X_train, X_test, vectorizer_type='tfidf', max_features=5000, ngram_range=(1, 2)\n",
        ")\n",
        "\n",
        "print(f\"Shape of vectorized training data: {X_train_vec.shape}\")\n",
        "print(f\"Shape of vectorized test data: {X_test_vec.shape}\")"
