        "        'Linear SVC': Pipeline([\n",
        "            ('clf', LinearSVC(\n",
        "                random_state=RANDOM_STATE,\n",
        "                class_weight='balanced'\n",
        "            ))\n",
        "        ]),\n",
        "        'Random Forest': Pipeline([\n",
        "            ('clf', RandomForestClassifier(\n",
        "                random_state=RANDOM_STATE,\n",
        "                class_weight='balanced',\n",
        "                n_estimators=100\n",
        "            ))\n",
        "        ])\n",
        "    }\n",
        "\n",
        "    return models\n",
        "\n",
        "# Melatih model\n",
        "def train_models(X_train, y_train, models, cv=5):\n",
        "    \"\"\"\n",
        "    Melatih multiple model\n",
        "    \"\"\"\n",
        "    results = {}\n",
        "\n",
        "    for name, model in models.items():\n",
        "        print(f\"Training {name}...\")\n",
        "        start_time = time.time()\n",
        "\n",
        "        # Cross-validation\n",
        "        cv_scores = cross_val_score(model, X_train, y_train, cv=cv, scoring='f1_macro')\n",
        "\n",
        "        # Training model\n",
        "        model.fit(X_train, y_train)\n",
        "        training_time = time.time() - start_time\n",
        "\n",
        "        results[name] = {\n",
        "            'model': model,\n",
        "            'cv_mean_f1': cv_scores.mean(),\n",
        "            'cv_std_f1': cv_scores.std(),\n",
        "            'training_time': training_time\n",
        "        }\n",
        "\n",
        "        print(f\"  {name} - F1 Macro: {cv_scores.mean():.4f} (±{cv_scores.std():.4f})\")\n",
        "        print(f\"  Training time: {training_time:.2f} seconds\")\n",
        "\n",
        "    return results\n",
        "\n",
        "# Membuat dan melatih model\n",
        "models = create_models()\n",
        "model_results = train_models(X_train_vec, y_train, models, cv=5)"
